import { useState } from 'react';

export default function Sample({value,min,max}) {
  const [count, setCount] = useState(value);

  function handleIncr() {
    if(count<max)
        {
            setCount(count+1);
        }
  }

  function handleDecr(){
    if(count>min)
        {
            setCount(count-1);
        }
  }

  return (
    <>
      <p>The value of count is {count}</p>
      <button onClick={handleIncr}>Click me</button>
      <button onClick={handleDecr}>Click me</button>
    </>
  );
}
